import React, { Component } from "react";
import { Div } from "./Style";
import DemoCarousel from "./Component/Transaction/Transaction";
import Headercontent from "./Component/Headercontent/Headercontent";
import Demo from "./Component/Header/Header";

export default class App extends Component {
  state = {};
  render() {
    return (
      <div>
        <Div>
          <Headercontent />
        </Div>
        <div style={{ width: "100%", backgroundColor: "#eeeeee" }}>
          <Div>
            <DemoCarousel />
          </Div>
        </div>
        <Header />
      </div>
    );
  }
}
